&quot;Sometimes only family can fulfill your needs. When his stepdaughter is accepted onto her college cheerleading squad, a man's forbidden fantasies suddenly turn into a provocative reality. A woman's new career as a massage therapist becomes the ultimate foreplay when her stepson gets injured after a football game and requests her services. Sexual tension builds, and subsequently explodes, as a father and step daughter impatiently wait for her mother to leave for work each morning. After manipulating her stepson into buying her a new pair of shoes each week, a woman decides that seduction is the ultimate payback for his generosity.&quot;


